import React , {Component} from 'react';
import {Route,Switch,Redirect} from "react-router-dom";
import Axios from 'axios';
import CreateBoard from './../src/pages/CreateBoard/CreateBoard';
import AllBoards from './../src/pages/AllBoards/AllBoards';
import Board from './../src/pages/Board/Board';



class AppRouter extends Component {

    state = {
        boardContents: {}
    }

    componentDidMount() {
        Axios.get('https://pro-organiser-app.firebaseio.com/boardContents.json')
            .then(response => {
                console.log(response);
                this.setState({
                    boardContents: response.data
                })
            })
            .catch(error => {console.log(error)});
    }
    render() {
    return (
    <Switch>
        <Route path="/createboard" component = {CreateBoard}></Route>
        <Route path="/" component = {<AllBoards boardContents = {this.state.boardContents}/>}></Route>
        <Route path="/board" component = {Board}></Route>
        <Route path="*" render = {() => <h3>Page not Found!</h3>}></Route>
    </Switch>
    );
    }
}

export default AppRouter;
